The simplest way to do it. Paperbit constructor is creating the canvas on the HTML element that is provided (document.body) and is also creating an api instance already linked with the canvas. const bit = new Paperbit(document.body)
const { ellipse, mouse } = bit.api bit.api.onDraw = () => { ellipse(...mouse.pos, .1)
}

