Finally we have our project setup, now we can use the Paperbit library. All the javascript code will be inside the src folder, so feel free to add new files when your main gets big. At the moment, we have to initialize the library, so replace the code you have in the entrypoint (main.js) with the following: import { Paperbit } from "paperbit" const paperbit = new Paperbit()
const { ellipse, mouse } = paperbit.api paperbit.api.onDraw = () => { ellipse(...mouse.pos, .1)
} Now serve it (npm run serve) and the fun part begins.
